Le diabète de type 2 est caractérisé par les lésions microangiopathiques et macroangiopathiques dues à l''effet du glucose présent dans le sang (glycémie) sur les organes. Plus la quantité de glucose dans le sang est élevée (hyperglycémie) et pendant une longue période, plus les lésions risquent d''être nombreuses et sévères. La limite entre un taux de glucose normal et un taux à risque de développement de lésions est imprécise.', 'https://www.has-sante.fr/jcms/c_750179/fr/ald-n8-diabete-de-type-2', 0, 120, 'sex_MF', 'besoin d''uriner, envie d''uriner, trop d''urine, urine trop frequement, urine frequement, envie fréquente d’uriner, uriner la nuit, augmentation de la faim, augmentation de la soif, plus faim, plus soif, très faim, très soif, sensation de bouche sèche, bouche sèche,somnolence excessive, envie de dormir, somnolence, vision trouble, moins bonne vision, infections bactériennes, infection à champignon, infections urinaires, vaginites, diabète, diabète 2, diabete de type 2', 'diabète non insulinodépendant, dnid, diabète insulinorésistant, diabète de l''âge mûr , diabète acquis', 'diabete de type 2', NULL, '\x80209544202020202020205d94288c20676c7963c3a96d69655f32685f6869672e2e2e205b37395d', '2019-08-31 15:03:21', 7, '2020-01-22 20:24:12', 7, 'Dans un premier temps, le médecin et le patient chercheront à adapter ensemble le traitement à la vie du patient et aux réactions de son corps. En effet, durant cette période, le patient devra pratiquer des glycémies quotidiennes (à pluriquotidiennes).

Il devra avoir un exercice physique régulier (30 minutes de marche 3 fois par semaine minimum) et on veillera à réduire le surpoids.

Il faut bien penser que l''alimentation sera très surveillée, mais c''est au médecin d''adapter le régime alimentaire à la vie du patient.

Pour la bonne réussite du traitement et afin de réduire des variations indésirables de la glycémie, le patient doit respecter les prescriptions diététiques et médicamenteuses.

Dans certains cas, le taux de l''hémoglobine glyquée pourra être surveillé.
L''étape suivante, si nécessaire, est un traitement par des antidiabétiques oraux. Une insulinothérapie peut parfois s''avérer nécessaire pour maintenir une glycémie normale. Ce type de traitement, favorisé depuis des dizaines d''années, est cependant remis en question pas des études récentes en raison de l''absence de diminution du taux de mortalité et des nombreux effets secondaires liés à ce traitement.', '', 'E119', NULL);
