', NULL, 'tuberculose', NULL, '\x80209520202020202020205d948c20616c62756d696e655f6c6f7794612e', '2019-09-25 19:43:04', 2, '2020-01-22 20:31:03', 7, 'Le traitement est d''une durée de six mois pour une tuberculose pulmonaire à bacille de Koch sensible chez un patient immunocompétent, comprenant 2 mois de quadrithérapie antibiotique (isoniazide, rifampicine, pyrazinamide et éthambutol), puis 4 mois de bithérapie (isoniazide et rifampicine). Le traitement prolongé est indispensable afin de guérir la maladie et éviter l''émergence de souches résistantes dont l''évolution est souvent beaucoup plus grave.', '', 'A19', NULL);
pancréatites, thromboses veineuses', 'crohn', 'maladie de crohn', NULL, '\x80209520202020202020205d94288c2074656d705f68696768948c20616c62752e2e2e205b34335d', '2019-08-29 06:29:28', 7, '2020-01-22 20:23:38', 7, 'Les causes de la maladie de Crohn restant inconnues, il n’existe aucun traitement permettant d’en guérir. Le traitement médical repose sur la réduction de l''inflammation. Le traitement est basé sur deux principes : le premier consiste à traiter le malade au cours des poussées ; c’est ce que l’on appelle le traitement d’attaque. Le second principe est la prévention des rechutes. C’est le traitement d’entretien qui permet de prolonger au maximum les périodes de rémission de la maladie.', '', 'K50', NULL);


