INSERT INTO public.pathology VALUES (629, 'diabète de type 2', 'Le diabète de type 2 est une maladie métabolique touchant la glycorégulation.
INSERT INTO public.pathology VALUES (819, 'insuffisance cardiaque gauche', 'L’insuffisance cardiaque gauche', 'https://www.has-sante.fr/jcms/c_534673/fr/ald-n5-insuffisance-cardiaque-a-fonction-systolique-preservee, https://www.has-sante.fr/jcms/c_534689/fr/ald-n5-insuffisance-cardiaque-systolique', 0, 120, 'sex_MF', 'Insuffisance cardiaque, orthopnée, dyspnée d''effort, choc de pointe, eclat du deuxieme bruit pulmonaire, rales crépitants, epanchement pleural, cyanose, nycturie, oligurie, marbrures, asthénie, choc cardiogénique, anorexie, dénutrition, oedeme aigu pulmonaire, OAP, toux, hemoptysies, dyspnée de repos, dyspnée, hemoptysie, fatigue constante, essoufflement, essoufflements, respiration courte, respiration sifflante, palpitations, douleur dans la poitrine, douleurs dans la poitrine, douleur poitrine, douleur thorax, mal au cœur, douleur cœur, serrement poitrine, augmentation de la fréquence des mictions nocturnes, urines nocturnes plus fréquente, plus de mictions nocturnes, toux, tousse, gain de poinds, rétention d’eau
INSERT INTO public.pathology VALUES (687, 'epilepsie', 'Une crise épileptique est caractérisée par une altération fonctionnelle transitoire au sein d''une population de neurones (soit limitée à une région du cerveau : crise dite « partielle », soit impliquant les deux hémisphères cérébraux de manière simultanée : crise dite « généralisée ») due à une décharge épileptique.', 'https://www.has-sante.fr/jcms/c_586170/fr/ald-n9-epilepsies-graves', 0, 120, 'sex_MF', 'périodes de perte de conscience, périodes de conscience altérée, perte de conscience, conscience altérée, yeux ouverts, regard fixe, pas de réaction, ne réagit plus, Chute brutale de la personne sans raison apparente, chute, chute brutale, chute soudaine, convulsions, contractions musculaires prolongées, contractions involontaires des bras et des jambes, convulse, perceptions transformées, sens altérés, goût altéré, odorataltéré, respiration bruyante, effrayé, a peur, est effrayé, est apeuré, panique, colère, hallucination olfactive, effet visuel, irritabilité, agitation', 'crise d''epilepsie', 'epilepsie', NULL, '\x80205d942e', '2019-09-01 16:55:57', 7, '2020-01-22 20:24:34', 7, 'L''emploi d''un anti-convulsivant est recommandé dès la dixième minute de convulsions, par voie intraveineuse si possible, par voie anorectale sinon. L''état de mal convulsif, c''est-à-dire lorsque la crise se prolonge au-delà de 10 min (ou lorsque trois crises se succèdent), nécessite un transfert en réanimation médicale (urgence médicale car le pronostic vital est en jeu). Un EEG en urgence ainsi qu''un bilan médical devront être effectués, sans retarder la mise en œuvre des méthodes de réanimation et le traitement médicamenteux :
INSERT INTO public.pathology VALUES (614, 'cystite', 'Une cystite est une inflammation de la vessie. Infection urinaire la plus courante, elle est le plus souvent d''origine bactérienne (colibacilles, naturellement présents dans l''intestin) ; mais peut aussi être due à un agent toxique : traitement anti-cancéreux ou radiothérapie. C''est une infection fréquente chez la femme, car elle possède un urètre court, ce qui augmente le risque d''infection urinaire et que les sécrétions de la prostate des hommes contiennent des substances qui ralentissent la multiplication des bactéries dans l’urètre.', 'https://www.has-sante.fr/jcms/c_2722827/fr/cystite-aigue-simple-a-risque-de-complication-ou-recidivante-de-la-femme, https://www.has-sante.fr/jcms/c_2722927/fr/femme-enceinte-colonisation-urinaire-et-cystite', 0, 120, 'sex_MF', 'Cystite infectieuse, bactéries intestinales, Cystite radique, Cystite à urine claire, cystite, cystite interstitielle, Cystite à champignon, vaginite à mycoses, Cystite allergène, Cystite de blessure, Cystite d''origine médicamenteuse, brûlures mictionnelles, inflammation de la vessie, inflammation vessie, vessie inflammée, pollakiurie, émission excessivement fréquente d''urine en faible quantité, envie d''uriner, envie d''uriner fréquente, envie d''uriner tout le temps, besoin d''uriner tout le temps, besoin d''uriner fréquent, impériosité urinaire, besoin d''aller uriner dans l''immédiat, tiraillement, douleurs hypogastriques, douleur bassin, hématurie, présence de sang dans l''urine, sang dans les urines, pyurie, présence de pus dans l''urine, pus dans l''urine', NULL, 'cystite', NULL, '\x80205d942e', '2019-08-29 06:49:57', 7, '2020-01-22 20:29:06', 7, 'Il est important de soigner rapidement une cystite, car l''infection peut se compliquer et atteindre le rein et causer une pyélonéphrite. Une pause de l''activité sexuelle est préconisée afin de faciliter au mieux la guérison.
INSERT INTO public.pathology VALUES (1170, 'sclérose en plaques', 'La sclérose en plaques (SEP) est une maladie auto-immune qui touche des individus génétiquement prédisposés mais qui semble déclenchée par des éléments environnementaux qui agissent comme des facteurs de dérégulation de l''immunité, d''inflammation et de dégénérescence des nerfs', 'https://www.has-sante.fr/jcms/c_2656983/fr/sclerose-en-plaque-de-l-enfant, https://www.has-sante.fr/jcms/c_460315/fr/ald-n25-sclerose-en-plaques', 0, 120, 'sex_MF', 'clérose en plaques, trouble de la vue, troubles de la vue, vision double, perte de vision, douleur aux yeux, mouvement des yeux douloureux, mouvements oculaires douloureux, mouvements oculaires, involontaires, voile devant un oeil, névrite optique, troubles sensitifs, fourmillements, décharges électriques, engourdissement, fatigue, tremblements, trouble de la marche, difficulté à contrôler ses mouvements, perte d’équilibre, spasmes musculaires, contractures musculaires, difficulté d’élocution, incontinence urinaire, troubles urinaires, constipation, paralysie partielle, troubles de la mémoire, troubles de la concentration
INSERT INTO public.pathology VALUES (657, 'eczéma', 'L''eczéma est un syndrome, ensemble de signes cliniques et de symptômes communs à plusieurs affections, pouvant correspondre à plusieurs maladies inflammatoires de la peau. Ces maladies sont caractérisées par des démangeaisons (prurit), une rougeur congestive de la peau (érythème) et des éruptions cutanées.', NULL, 0, 120, 'sex_MF', 'inflammation peau, peau inflammée, exema, eczema, demangeaison, prurit, rougeur peau, rougeur congestive peau, erytheme, eruptions, eruptions cutanées, eruption cutanée, boutons, plaques rouges, peau rouge, plaque rouge, ', 'exéma', 'eczema', NULL, '\x80205d942e', '2019-09-01 11:16:43', 2, '2020-01-22 20:29:12', 7, 'La gestion de ce syndrome repose sur l''utilisation de crèmes à base de cortisone diminuant les démangeaisons et l''inflammation, la prise d''antihistaminiques. Un traitement par rayons ultraviolets comme la photothérapie ou photo chimiothérapie peut également être prescrit.', '', 'L20', NULL);
INSERT INTO public.pathology VALUES (811, 'infarctus du myocarde', 'L''infarctus du myocarde est une nécrose d''une partie du muscle cardiaque secondaire due à un défaut d''apport sanguin dans le cadre de la maladie coronarienne.', 'https://www.has-sante.fr/jcms/c_2676802/fr/prise-en-charge-hospitaliere-de-l-infarctus-du-myocarde, https://www.has-sante.fr/jcms/c_1725826/fr/endoprothese-vasculaire-sans-infarctus-du-myocarde, https://www.has-sante.fr/jcms/c_484720/fr/prise-en-charge-de-l-infarctus-du-myocarde-a-la-phase-aigue-en-dehors-des-services-de-cardiologie', 0, 120, 'sex_MF', 'Infarctus du myocarde, douleur intense, douleur poitrine, douleur intense poitrine, oppression, douleur bras, douleur qui irradie le bras gauche, douleur bras gauche, douleur main gauche, douleur dou, douleur machoire, douleur dos, essouflement, sueurs froides, nausées, vomissements, malaise, vertige, vertiges, etourdissement, etourdissements, douleurs abdominales, douleur abdominale, battements rapides, battements irreguliers, tachycardie, arythmie, malaises, douleurs abdominales, anxiete importante, anxieux, anxiete soudaine, fatigue, agitation trouble du sommeil, perte de conscience', NULL, 'infarctus du myocarde', NULL, '\x80205d942e', '2019-09-10 07:23:22', 7, '2020-01-22 20:22:35', 7, 'Il s''agit d''une urgence médicale. L''hospitalisation doit être faite en unités spécialisées.', '', 'I21', NULL);
INSERT INTO public.pathology VALUES (729, 'goutte', 'La goutte est une maladie chronique fréquente liée au métabolisme de l''acide urique, dont la manifestation clinique la plus caractéristique est une monoarthrite aiguë du gros orteil. Elle est associée, bien que de façon inconstante, à une augmentation du taux circulant d''acide urique (hyperuricémie).', NULL, 0, 120, 'sex_MF', 'douleur, douleur soudaine, douleur intense, douleur pulsatile douleur dans une articulation, crises, articulations froides, transformation de l’acide urique liquide en cristaux d’acide urique, enflure, rougeur de la région atteinte, grande sensation de froid, douleurs articulaires généralisées, malaise général, fièvre, frissons', NULL, 'goutte', NULL, '\x80209520202020202020205d948c2061636964655f7572697175655f94612e', '2019-09-03 17:06:51', 7, '2020-01-22 20:22:56', 7, 'La prise en charge thérapeutique de la goutte comprend un volet symptomatique (soulagement des crises par les anti-inflammatoires non stéroïdiens ou par la colchicine) et un traitement de fond (règles hygiéno-diététiques et dans certains cas médicaments hypo-uricémiants). Elle est complétée par une prise en charge en ergothérapie pour le soulagement des douleurs, l''éducation thérapeutique ainsi que la prévention articulaire.', '', 'M10', NULL);
INSERT INTO public.pathology VALUES (493, 'asthme chronique', 'L''asthme chronique est une hyperactivité chronique des bronches peu soumise aux agents extérieurs. L''inflammation est souvent d''installation lente et progressive, généralement présente depuis l''enfance.
INSERT INTO public.pathology VALUES (1282, 'tuberculose', 'La tuberculose est une maladie infectieuse causée par la bactérie Mycobacterium tuberculosis, contagieuse, avec des signes cliniques variables. ', 'https://www.has-sante.fr/jcms/c_482999/fr/ald-n29-tuberculose-maladie', 0, 120, 'sex_MF', 'tuberculose, fièvre, haute température, température élevée, toux, expectorations couleurs inhabituelles, crachats sanguinolents, crachats sang, toux sang, expectorations sang, perte appétit, perte poids, amincissement, amaigrissement, sueurs nocturnes, sudation, douleurs poitrine respiration, douleurs poitrine toux,  douleurs colonne vertébrale, douleurs articulations
INSERT INTO public.pathology VALUES (610, 'maladie de crohn', 'La maladie de Crohn est une maladie inflammatoire chronique de l''intestin (MICI) qui peut atteindre toute partie de l''appareil digestif (de la bouche à l''anus) et éventuellement la peau, les articulations et les yeux. De cause inconnue, cette maladie est caractérisée par une inflammation le plus souvent retrouvée au niveau de l''iléon et du côlon, qui serait d''origine multifactorielle, faisant intervenir entre autres une composante génétique et le microbiome.', 'https://www.has-sante.fr/jcms/c_671094/fr/ald-n-24-maladie-de-crohn', 0, 120, 'sex_MF', 'Crohn, maladie de Crohn, poussées alternant avec des phases de rémission, phases de rémission, rémission, douleur abdominale, douleur abdominale qui s''accentue après les repas, douleur après manger, douleur après repas, douleur abdominale après repas, douleur abdominale après manger,  diarrhées, diarrhée, diarrhées chroniques, diarrhée chronique, fièvre, fatigue persistante, fatigue,  perte de poids, dysphagie, douleur en mangeant, nausées, vomissements, aphtes dans la bouche, aphtes, hypoalbuminémie, calculs rénaux, coliques néphrétiques, spondylarthropathie, érythèmes noueux, atteintes oculaires, uvéite antérieure, épisclérite, diplopie, hypersensibilité à la lumière,
